INSERT INTO `v1_de4ee004915c4c1e2ba48dccd61c1a5b41716265ad70cc5410638994b67a5899` VALUES (16612031, 16612, 11, 102711, "ちょ、ちょっとアンナさん……\nあなた全身、絵の具だらけで\n動くたびに飛び散ってますわ。\n少し大人しくしてもらえますか？", 10, 1, 1, 0, 0, 0.5);
