INSERT INTO `v1_de4ee004915c4c1e2ba48dccd61c1a5b41716265ad70cc5410638994b67a5899` VALUES (16612036, 16612, 11, 101311, "あははっ！　そういうエリコ様も\nおててが絵の具だらけでござるよ～！\nむふふ、いわゆるギャップ萌え\nというやつですな？", 10, 1, 1, 0, 0, 0.5);
